import React, {Componenet} from 'react'
import ReactDOM from 'react-dom'
import './index.css'

class App extends React.Component {
    render() {
        return (
            <div className="App">
                <h1> Hello World </h1>
            </div>
        )
    };
}

ReactDom.render(<App />, document.getElementById('root'))
